import React, { Fragment } from "react";
import { Provider } from "react-redux";

import Movie from "./components/Movie";

import "./App.css";

import configureStore from "./store";
const store = configureStore();

function App() {
  return (
    <Provider store={store}>
      <Fragment>
        <div>hello</div>
        <Movie />
      </Fragment>
    </Provider>
  );
}

export default App;
